        props.response()
    }
    const clientId = "598472467027-00grf0h9akah4ieamklo0dhksmpa5j6g.apps.googleusercontent.com";
    return (
        <div>
            <GoogleLogout
                clientId={clientId}
                buttonText="Logout"
                onLogoutSuccess={logout}
            ></GoogleLogout>
        </div>
    )
}

export default Logout
